import React from "react";
import "./Form.scss";

const Form = () => {
  return (
    <div className="divForm">
      <label>Enviar Tweet</label>
      <form name="name">
        <div>
          <input type="text"></input>
        </div>

        <div className="divArea">
          <textarea id="textAreaModal" name="textAreaModal" rows="8"></textarea>
        </div>
      </form>
    </div>
  );
};

export default Form;
